DROP DATABASE opportunity;
CREATE DATABASE opportunity;

USE opportunity;


-- TABLE CLIENTES
CREATE TABLE clientes(
clienteid INT NOT NULL AUTO_INCREMENT, 
razaosocial VARCHAR(60) NOT NULL,
cnpjcpf VARCHAR(60) NOT NULL,
nomefantasia VARCHAR(60) NOT NULL,
site VARCHAR(60) NOT NULL,
phone1 VARCHAR(60) NOT NULL,
phone2 VARCHAR(60) NOT NULL,
contato VARCHAR(60) NOT NULL,
cargocontato VARCHAR(60) NOT NULL,
email VARCHAR(60) NOT NULL,
nomeendereco VARCHAR(60) NOT NULL,
tipologradouro VARCHAR(60) NOT NULL,
rua VARCHAR(60) NOT NULL,
numero VARCHAR(60) NOT NULL,
complemento VARCHAR(60) NOT NULL,
bairro VARCHAR(60) NOT NULL,
cep VARCHAR(60) NOT NULL,
pais VARCHAR(60) NOT NULL,
cidade VARCHAR(60) NOT NULL,
uf VARCHAR(2) NOT NULL,
inscestadual VARCHAR(60) NOT NULL,
inscmunicipal VARCHAR(60) NOT NULL,
cnae VARCHAR(60) NOT NULL,
banco VARCHAR(60) NOT NULL,
agencia VARCHAR(60) NOT NULL,
digitoagencia INT NOT NULL,
conta VARCHAR(60) NOT NULL,
digitoconta INT NOT NULL,
prazopagamento VARCHAR(60) NOT NULL,
rebate VARCHAR(60) NOT NULL,
formafaturamento VARCHAR(60) NOT NULL,
obs VARCHAR(60) NOT NULL,
emailuser VARCHAR(60) NOT NULL,
datacadastro VARCHAR(60) NOT NULL,
PRIMARY KEY (clienteid, cnpjcpf));

-- TABLE CLIENT MAPPING
CREATE TABLE clientmapping(
mappingid INT NOT NULL AUTO_INCREMENT,
nomecliente VARCHAR(60) NOT NULL,
businessmanager VARCHAR(60) NOT NULL,
accountmanager VARCHAR(60) NOT NULL,
emailuser VARCHAR(60) NOT NULL,
questao1 FLOAT (10,2) NOT NULL, -- 1) Qual o potencial de budget para ativações e eventos no ano?
questao2 INT NOT NULL, -- 2) Quantos solicitantes de eventos há na empresa?
questao3 VARCHAR(100) NOT NULL, -- 3) Quem são os maiores solicitantes (mais verba destinada à eventos)? (nome/cargo/e-mail/telefone)maiorcompr VARCHAR(50) NOT NULL,
questao4 VARCHAR(100) NOT NULL, -- 4) Quem é o maior comprador?
questao5 VARCHAR(100) NOT NULL, -- 5) Todos os BIDs passam por Compras? Descreva o processo de solicitações. Há uma área de Eventos na empresa? O Departamento de Compras se envolve? A solicitação vem direto do marketing/trade?
questao6 VARCHAR(100) NOT NULL, -- 6) Quais departamentos solicitam eventos? Que tipo de eventos casa um deles realiza?
questao7 VARCHAR(20) NOT NULL, -- 7) O processo é  job a job via homologação? (verificar contrato vigente)
questao8 VARCHAR(40) NOT NULL, -- 8) Se homologação, há contrato? Quando será feita a próxima homologação?
questao9 FLOAT(10,2), -- 9) Quanto comprou da MCI em 2017 / 2018?
questao10 VARCHAR(60) NOT NULL, -- 10) Quais são as agencias que estao dentro do cliente? (quem são nossos concorrentes?)
questao11 VARCHAR(60) NOT NULL, -- 11) Vocês homologam empresa de Cenografia e AV? Se sim, quando será feita a próxima homologação?
datacadastro varchar(20) not null,
PRIMARY KEY (mappingid, nomecliente));
	
-- TABLE GRUPOS
CREATE table grupos(
idgrupo INT NOT NULL AUTO_INCREMENT,
nomegrupo VARCHAR(20),
obs varchar(60),
PRIMARY KEY (idgrupo));


-- TABLE USUARIOS
CREATE TABLE usuarios(
userid INT NOT NULL AUTO_INCREMENT,
nomecomp VARCHAR(60) NOT NULL,
area VARCHAR(30) NOT NULL,
emailuser VARCHAR(60) NOT NULL UNIQUE,
password VARCHAR(15) NOT NULL,
idgrupo INT NOT NULL,
FOREIGN KEY (idgrupo) REFERENCES grupos (idgrupo),	
PRIMARY KEY (userid, emailuser));

-- MAPEAR PERMISSOES DE ACESSOS


-- TABLE SESSAO 
CREATE TABLE sessao(
id INT NOT NULL auto_increment,
userid INT NOT NULL,
sessaoid VARCHAR (60) NOT NULL,
emailuser VARCHAR(60) NOT NULL, 
data VARCHAR(20) NOT NULL,
FOREIGN KEY (userid) REFERENCES usuarios (userid),	
PRIMARY KEY (id));

-- TABLE PROJETOS
CREATE TABLE projetos(
projectid INT NOT NULL AUTO_INCREMENT,
area VARCHAR(30) NOT NULL,
estado VARCHAR(50) NOT NULL,
contatomci VARCHAR(30) NOT NULL,
propreqdate DATE NOT NULL, -- 'YYYY-MM-DD'
mcistdcliname VARCHAR (80) NOT NULL,
additionalclientname VARCHAR (80),
projectname VARCHAR (80) NOT NULL,
projectanalcode INT,
eventstartdate DATE, -- 'YYYY-MM-DD'
industrysector VARCHAR (80),
eventstatus VARCHAR (10) NOT NULL, -- past, present, future
eventclosingdate DATE,-- 'YYYY-MM-DD'
paxnumber INT,
cancelinsurance VARCHAR (30), -- verificar
probability INT NOT NULL,
projectstatus VARCHAR (10) NOT NULL, -- open, lost, confirmed
projectaudit VARCHAR (20) NOT NULL, -- EM PROD, AUDITADO, REALIZADO, não realizado
turnoverforowner FLOAT (10,2) NOT NULL,
gmforowner FLOAT (10,2) NOT NULL,
gmturnoverperc FLOAT (10,2), -- percentage
weightedprospec FLOAT (10,2) NOT NULL,
emailuser VARCHAR (60)  NOT NULL,
datacadastro VARCHAR(20) NOT NULL,
folderpath varchar(250), 
pais varchar(60),
customertype varchar (20),  
PRIMARY KEY (projectid, projectname));

CREATE TABLE itensprojetos(
itemid INT NOT NULL AUTO_INCREMENT,
projectid INT NOT NULL,
nomeitem VARCHAR(40) NOT NULL,
valoritem FLOAT (10,2),
soma VARCHAR (10) NOT NULL,
datacadastro VARCHAR(20) NOT NULL,
emailuser VARCHAR(40) NOT NULL,
FOREIGN KEY (projectid) REFERENCES projetos (projectid),	
PRIMARY KEY (itemid));


-- CREATE TABLE PROSPECTS 
CREATE TABLE prospects(
prospectid INT NOT NULL AUTO_INCREMENT, 
empresa VARCHAR(100) NOT NULL,
nomecontato VARCHAR(60),
telefone1 VARCHAR(60),
telefone2 VARCHAR(60),
email VARCHAR(60),
cargo VARCHAR(100),
origem VARCHAR(50), -- nacional / internacional
travel VARCHAR(3), -- sim ou nao
contatomci VARCHAR(60),
area VARCHAR(20),
datacadastro VARCHAR(20) NOT NULL,
user VARCHAR(60) NOT NULL,
PRIMARY KEY (prospectid));

-- CREATE TABLE ITENS PROSPECTS
CREATE TABLE itensprospects(
itemid INT NOT NULL AUTO_INCREMENT,
prospectid INT NOT NULL,
nomeitem VARCHAR(40) NOT NULL,
nomecontatoitem varchar (40) NOT NULL, 
briefing VARCHAR (60) NOT NULL,
datacadastro VARCHAR(20) NOT NULL,
emailuser VARCHAR(40) NOT NULL,
followup VARCHAR(5) NOT NULL,
FOREIGN KEY (prospectid) REFERENCES prospects (prospectid),	
PRIMARY KEY (itemid));



-- CREATE TABLE SUSPECTS 
CREATE TABLE suspects(
suspectid INT NOT NULL AUTO_INCREMENT, 
empresa VARCHAR(100) NOT NULL,
nomecontato VARCHAR(60),
telefone1 VARCHAR(60),
telefone2 VARCHAR(60),
email VARCHAR(60),
cargo VARCHAR(100),
origem VARCHAR(50), -- nacional / internacional
eventos VARCHAR(3), -- ??? 
incentivos VARCHAR(3), -- ???
contatomci VARCHAR(60),
area VARCHAR(20),
datacadastro VARCHAR(20) NOT NULL,
user VARCHAR(60) NOT NULL,
PRIMARY KEY (suspectid));


